import React, { Component } from "react";
import {
  faUserCircle,
  faPhone,
  faEnvelope
} from "@fortawesome/free-regular-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

class Contact extends Component {
  state = { email: "pharsh58@gmail.com", contactNo: "(+91) 8980078873" };
  render() {
    return (
      <div class="card">
        <FontAwesomeIcon className="card-img-top" icon={faUserCircle} />
        <div class="card-body">
          <h5 class="card-title">Contact Me</h5>
        </div>
        <ul class="list-group list-group-flush">
          <li class="list-group-item">
            <FontAwesomeIcon icon={faEnvelope} size="lg" fixedWidth />
            {this.state.email}
          </li>
          <li class="list-group-item">
            <FontAwesomeIcon icon={faPhone} size="lg" fixedWidth />
            {this.state.contactNo}
          </li>
        </ul>
      </div>
    );
  }
}

export default Contact;
